def get_data_frame_dictionary(data, items):
    data_frame = {}
    for j in items:
        data_frame.update({j: []})
        for i in range(len(data["Data"])):
            try:
                data_frame[j].append(data["Data"][i][j])
            except KeyError:
                data_frame[j].append("NaN")

    return data_frame

